    /*
    |--------------------------------------------------------------------------
    | EXPRESIO REGULARRAK
    |--------------------------------------------------------------------------
    */
    validateOnlyString: function validateOnlyString(value) {
      return /^[a-zA-Z ,.'-]{2,48}/i.test(value);
    },
    validateTelephone: function validateTelephone(value) {
      // return/^[679]{1}[0-9]{8}$/.test(value);
      return /^(\+34|0034|34|\+33|0033|33)?[ -]*(6|7|9)[ -]*([0-9][ -]*){8}/.test(value);
    },
    validateEmail: function validateEmail(mail) {
      return /^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,4})+$/.test(mail);
    },
    validateWeb: function validateWeb(web) {
      return /((?:http:\/\/)?|(?:https:\/\/)?)?(\w+:{0,1}\w*@)?(\S+)(:[0-9]+)?(\/|\/([\w#!:.?+=&%@!\-\/]))?/.test(web);
    },
    validateTwitter: function validateTwitter(acount) {
      return /^((?:http:\/\/)?|(?:https:\/\/)?)?(www\.)?twitter\.com\/(\w+)+$/.test(acount);
    },
    validateFacebook: function validateFacebook(acount) {
      return /^((?:http:\/\/)?|(?:https:\/\/)?)?(www\.)?facebook\.com\/(\w+)+$/.test(acount);
    },
    validateInstagram: function validateInstagram(acount) {
      return /^((?:http:\/\/)?|(?:https:\/\/)?)?(www\.)?instagram\.com\/(\w+)+$/.test(acount);
    },
    validateTelegram: function validateTelegram(acount) {
      return /^((?:http:\/\/)?|(?:https:\/\/)?)?(www\.)?t\.me\/(\w+)+$/.test(acount);
    },

